Guten Tag

Ihr Dossier mit der Dossier-Nr. {{INSTANCE_ID}} wurde erfolgreich übermittelt. Alle auf eBau hochgeladenen Pläne und Dokumente müssen unterschrieben, datiert und in mindestens zweifacher Ausfertigung mit dem Gesuchsformular bei der zuständigen Gemeinde eingereicht werden. Das Gesuch wird erst bearbeitet, wenn die Gemeinde das Papierdossier erhalten hat.

{{PUBLIC_DOSSIER_LINK}}

Gerne möchten wir erfahren wie einfach die elektronische Eingabe eines Gesuches war. Wir bitten Sie daher, sich 2 - 3 Minuten Zeit zu nehmen und den folgenden Fragebogen zu beantworten. Besten Dank.

https://www.onlineumfragen.com/login.cfm?umfrage=87201

Freundliche Grüsse
{{LEITBEHOERDE_NAME}}

*** version française ***

Madame, Monsieur,

Votre dossier portant le numéro de dossier {{INSTANCE_ID}} a été déposé/e avec succès. Tous les plans et documents téléchargés sur eBau doivent être signés, datés et envoyés en au moins deux exemplaires avec le formulaire de demande de permis de construire à la commune responsable. La demande ne sera traitée que lorsque la commune aura reçu le dossier papier.

{{PUBLIC_DOSSIER_LINK}}

Veuillez agréer, Madame, Monsieur, nos salutations les meilleures.
{{LEITBEHOERDE_NAME}}

Guten Tag

Das Baugesuch mit der eBau-Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) wurde erfolgreich abgeschlossen. Das Baubewilligungsverfahren wird von der Gemeinde {{LEITBEHOERDE_NAME}} eröffnet.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

*** version française ***

Madame, Monsieur,

La demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}) a été transmise avec succès. La commune de {{LEITBEHOERDE_NAME}} ouvre la procédure d'octroi du permis de construire.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

Guten Tag

Das Baugesuch mit der eBau-Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) wurde erfolgreich übermittelt. Das Verfahren wird nun ausgelöst. Sie werden über die Statusmeldungen informiert. 

{{PUBLIC_DOSSIER_LINK}}

Freundliche Grüsse
{{LEITBEHOERDE_NAME}}

*** version française ***

Madame, Monsieur,

La demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}) a été déposée avec succès. La procédure est ouverte et tout changement de statut vous sera communiqué. 

{{PUBLIC_DOSSIER_LINK}}

Veuillez agréer, Madame, Monsieur, nos salutations les meilleures.
{{LEITBEHOERDE_NAME}}

Guten Tag

Das Baugesuch mit der eBau-Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) wurde formell geprüft. Sie erhalten den Brief mit dem Prüfresultat beigefügt.

{{PUBLIC_DOSSIER_LINK}}

Freundliche Grüsse
{{LEITBEHOERDE_NAME}}

*** version française ***

Madame, Monsieur,

La demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}) a fait l'objet d'un examen formel dont le résultat vous est communiqué dans le courrier ci-joint.

{{PUBLIC_DOSSIER_LINK}}

Veuillez agréer, Madame, Monsieur, nos salutations les meilleures.
{{LEITBEHOERDE_NAME}}

Guten Tag

Wir leiten Ihnen zuständigkeitshalber das Baugesuch mit der eBau-Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) zur Fortsetzung des Baubewilligungsverfahrens weiter.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

*** version française ***

Madame, Monsieur,

Veuillez trouver ci-joint la demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}), dont la poursuite du traitement relève de votre compétence.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

Guten Tag

Das Baubewilligungsverfahren für das Baugesuch mit der eBau Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) wurde zuständigkeitshalber übernommen. 

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

*** version française ***
Madame, Monsieur,

Notre autorité se charge de la demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}), qui relève de sa compétence. 

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

Guten Tag

Die Baubewilligungsbehörde {{LEITBEHOERDE_NAME}} hat das Gesuch mit der eBau Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) zurückgewiesen. Das Gesuch kann nun angepasst und erneut eingereicht werden.

{{PUBLIC_DOSSIER_LINK}}

Mitteilung der Baubewilligungsbehörde:

{{REJECTION_FEEDBACK}}

*** version française ***

Madame, Monsieur, 

L'autorité du permis de construire {{LEITBEHOERDE_NAME}} a la pétition avec eBau N° {{EBAU_NUMBER}}. ({{INSTANCE_ID}}) a été rejetée. La demande peut maintenant être adaptée et soumise à nouveau. 

{{PUBLIC_DOSSIER_LINK}}

Veuillez agréer, Madame, Monsieur, nos salutations les meilleures.

{{REJECTION_FEEDBACK}}

Guten Tag

Sie erhalten das Baugesuch mit der eBau Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) zur Ausarbeitung einer Stellungnahme eines Amts- Fachberichtes oder einer Verfügung gemäss Verfahrensprogramm.

{{INTERNAL_DOSSIER_LINK}}

{{CURRENT_SERVICE}}

*** version française ***

Madame, Monsieur,

Veuillez trouver ci-joint la demande de permis de construire portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}) au sujet de laquelle vous voudrez bien prendre position, rédiger un rapport officiel ou un rapport technique ou encore rendre une décision conformément au déroulement de la procédure.

{{INTERNAL_DOSSIER_LINK}}

{{CURRENT_SERVICE}}

Guten Tag 

Die gesetzte Frist im Baubewilligungsverfahren für das Baugesuch mit der eBau Nr. {{EBAU_NUMBER}} ({{INSTANCE_ID}}) ist abgelaufen. Fehlende Stellungnahmen,  Amts- und Fachberichte, Verfügungen sind bei betroffenen Stellen nachzufordern.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

** version française ***

Madame, Monsieur, 

Le délai fixé dans la procédure d'octroi du permis de construire relative à la demande portant le numéro eBau {{EBAU_NUMBER}} ({{INSTANCE_ID}}) est échu. Il convient donc de réclamer les prises de position, les rapports officiels ou techniques ou encore les décisions aux instances qui ne les auraient pas encore remis.

{{INTERNAL_DOSSIER_LINK}}

{{LEITBEHOERDE_NAME}}

Guten Tag

Zu dem von Ihnen eingereichten Baugesuch mit der eBau Nr. {{EBAU_NUMBER}} wurden von der Leitbehörde Korrekturen erfasst. Sie können das korrigierte Gesuch unter folgendem Link einsehen:

{{PUBLIC_DOSSIER_LINK}}

